import * as React from "react";

import {
  interaction,
  layer,
  custom,
  control, //name spaces
  Interactions,
  Overlays,
  Controls, //group
  Map,
  Layers,
  Overlay,
  Util //objects
} from "react-openlayers";

export default class FullScreen extends React.Component<any, any> {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <a href='https://github.com/allenhwkim/react-openlayers/blob/master/app/controls/full-screen.tsx'>
          source
        </a>
        <Map>
          <Controls>
            <control.FullScreen />
          </Controls>
        </Map>
      </div>
    );
  }
}
